li-bullet-0"><span class="c1">Version-3 (03-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">FixIssu: theme responsive issue fix</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-4 (06-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">Update: theme layout some updates and change</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-5 (09-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New: Order process system change</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-6 (15-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New: checkout page terms and condition checkbox dynamically show/hide</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-7 (18-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">Update: login form style change</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-8 (21-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">Update: style change of checkout form</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-9 (24-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">Update: login OTP character describe 5 to 4 for more quick login</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-10 (28-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New: product display writer based</span></li><li class="c0 li-bullet-0"><span class="c1">New: Homepage serializes features dynamically</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-11 (29-Aug-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New: headline show/hide dynamically</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-12 (15-Sep-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New: flash Sales section add home page</span></li><li class="c0 li-bullet-0"><span class="c1">New: flash Sales separate page</span></li><li class="c0 li-bullet-0"><span class="c1">New: flash Sales &nbsp;show/hide/set time dynamically</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-13 (01-Oct-2022)</span></li></ul><ol class="c2 lst-kix_4xzpqu9nscc9-1 start" start="1"><li class="c0 li-bullet-0"><span class="c1">New Feature: home page section-based product show limit set dynamically</span></li><li class="c0 li-bullet-0"><span class="c1">New Feature: site language change features</span></li></ol><p class="c3"><span class="c1"></span></p><ul class="c2 lst-kix_4xzpqu9nscc9-0"><li class="c4 li-bullet-0"><span class="c1">Version-14 (15